    useEffect(() => {
        const getEmailData = async () => {
            const email = user?.primaryEmailAddress?.emailAddress!;
            const data = await fetchData(email);
            if (data && data.Checked_In !== "") {
                // console.log("Data found:", data.Attendee_Name);
                setAttendeeName(data.Attendee_Name);
                toast({
                    title: "Data found",
                    description: `Data found for ${data.Attendee_Name}`,
                });
                generateSVGText(data.Attendee_Name).then(svgResult => {
                    setAttendeeNameSVG(svgResult);
                }).catch(error => {
                    console.error(error);
                });
                toast({
                    title: "Certificate generated",
                    description: `Certificate generated for ${data.Attendee_Name}`,
                });
            } else {
                if (!isSignedIn) {
                    toast({
                        variant: "destructive",
                        title: "You are not signed in",
                        description: `Please sign in to view your certificate.`,
                    });
                }
                else {
                    if (appscriptFetchError === false) {
                        toast({
                            variant: "destructive",
                            title: "Data not found",
                            description: "Data not found for the specified email.",
                        });
                    }
                    else {
                        toast({
                            variant: "destructive",
                            title: "Server is in Maintanence",
                            description: "Please try again later.",
                        });
                    }
                }
                setAttendeeNameSVG(null);
            }
        };

        getEmailData();
        // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [isSignedIn, toast, user]);

    // console.log(attendeeNameSVG);

    return (
        <>
            <title>Webverse | Apexia Certificate</title>
            <div className="w-full max-w-[90%] mx-auto justify-center min-h-screen">
                <div className="flex items-center">
                    <Link href="../" className="cursor-pointer">
                        <Label className="text-lg cursor-pointer underline">Apexia Certificate</Label>
                    </Link>
                    <ChevronRight />
                    <Label className="text-lg cursor-pointer underline">Webverse Part One Event 1</Label>
                </div>
                {/* Certificate Section */}
                <div className="flex my-5 max-sm:justify-center">
                    <Card className="flex max-sm:flex-col w-full justify-between">
                        <CardHeader>
                            <svg width="842" height="595" id="certificate" viewBox="0 0 842 595" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                                <rect width="842" height="595" fill="url(#pattern0)" />
                                {/* <text x="50%" y="50%" text-anchor="middle" font-family="READYFORANYTHINGBB-REGULAR" font-size="24" fill="black">
                                    {`${attendeeName || "Attendee Name"}`}
                                </text> */}
                                <path d={`${attendeeNameSVG || tempPath}`} fill="#1A1A1A" />
                                {/* <g className="flex w-full justify-center items-center"> */}
                                {/* </g> */}
                                <defs>
                                    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                                        <use xlinkHref="#image0_8_11239" transform="scale(0.000296912 0.000420168)" />
                                    </pattern>
                                    <image id="image0_8_11239" width="3368" height="2380" xlinkHref="data:image/png;base64," />
                                </defs>
                            </svg>

                        </CardHeader>
                        <div className="p-4 flex flex-col w-full max-sm:p-0">
                            <CardContent>
                                <div className="flex flex-col gap-2">
                                    <CardTitle className="flex flex-col gap-2">
                                        <Label className="flex items-center text-4xl max-sm:text-2xl">
                                            Webverse Part One Event 1
                                        </Label>
                                        <Separator />
                                    </CardTitle>
                                    <CardDescription>
                                        <Label className="flex items-center max-sm:text-sm text-lg gap-2">
                                            <MapPin size={18} className="max-sm:w-4" />
                                            IT Seminar Hall, SVIT
                                        </Label>
                                    </CardDescription>
                                    <CardDescription>
                                        <Label className="flex items-center max-sm:text-sm text-lg gap-2">
                                            <CalendarDays size={18} className="max-sm:w-4" />
                                            Tuesday, 12th March
                                        </Label>
                                    </CardDescription>
                                </div>
                            </CardContent>
                            <CardFooter>
                                {attendeeNameSVG && (
                                    <Button className="cursor-pointer" onClick={handleSvgPdfDownload}>
                                        <Label className="flex items-center max-sm:text-sm text-lg gap-2 cursor-pointer">
                                            Download Certificate
                                            <Download size={18} className="max-sm:w-4" />
                                        </Label>
                                    </Button>
                                )}
                            </CardFooter>
                        </div>
                    </Card>
                </div>
            </div>
        </>
    );
